(3, 'tipsport-extraliga-2022-2023-2022-09-10', NULL, '2022-09-10', 3, 'Tipovačka Tipsport extraliga 2022/2023', NULL, 'Jako poslední roky, tak i tento jsme pro Vás připravili tipovačku Tipsport Extraligy.', NULL, '<h4>Pravidla a popis tipovačky Tipsport extraligy 2022/2023</h4><p>Jako poslední roky, tak i tento jsme pro Vás připravili tipovačku Tipsport Extraligy. Tohle je první tipovačka v novém prostředí, online, což věříme že povede k většímu komfortu. A u jedné tipovačky nezůstane, budou další, což můžete vidět v seznamu budoucích tipovaček.</p><p><strong>Kdo se může zúčastnit</strong></p><p>Tipovačka je pro registrované uživatele fóra. Vše lze řešit individuálně a vyhrazujeme si právo uživatele zablokovat (například při porušení pravidel fóra) nebo neschválit. Je to benefit pro skvělé uživatele skvělého fóra pardubických fanoušků.&nbsp;</p><p><strong>Co tipujeme a jak to hodnotíme</strong></p><p>Tipujeme celkové pořadí týmů (po základní části) a zápasy našeho Dynama včetně play-off. Celkové pořadí týmů lze tipovat do 30.9.2022 a každý zápas lze tipovat skoro do začátku zápasu (vždy je uvedeno u tipu do kdy). Tabulka v celkovém pořadí musí být unikátní, čili nelze mít stejné umístění pro dva týmy. Zápasy tipujeme bez remíz! a konečný výsledek (po prodloužení či nájezdech).</p><ul><li>Trefa v pořadí - 10 bodů</li><li>Trefa o jedno místo v pořadí - 5 bodů</li><li>Trefa o dvě místa v pořadí - 3 body</li><li>Přesně tipnutý výsledek zápasu - 3 body</li><li>Tipnutý vítěz a rozdíl ve skóre - 2 body</li><li>Tipnutý vítěz - 1 bod</li><li>Play-Off - v playoff se vie násobí koeficientem 2, čili jsou dvojnásobné body za zápasy play-off.</li></ul><p><strong>O co hrajeme</strong></p><p>Doplníme, pokud někdo chce dát nějakou sponzorskou odměnu do tipovačky, pošlete SZ na fóru na <span style=\\\"color:hsl(0,75%,60%);\\\"><strong>av69</strong></span> a domluvíte se. Aktuálně do tipovačky je poslán poukaz za první místo z poslední tipovačky, za který nakoupíme něco ve fanshopu. Pokusíme se odměnit prvních 10 tipujících.&nbsp;</p><p><strong>A jak tipovat</strong></p><p>V seznamu tipovaček či po přihlášení vidíte tipovačky. Oddělení jsou tři: probíhající tipovačky, nadcházející tipovačky a uplynulé tipovačky. Přihlásit se jde pouze do probíhajících tipovaček a uplynulé tipovačky jdou zobrazit jen těm, kteří se jich zúčastnili.&nbsp;</p><figure class=\\\"image\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/__thumbs/20220609_tipovacka-001.png/20220609_tipovacka-001__480x265.png\\\"></figure><p>Do každé tipovačky je třeba se registrovat. Registrací se zařadíte do pořadí tipovačky a můžete tipovat. Pokud se nechcete registrovat, dejte zpět, jinak klikněte na tlačítko registrovat se do tipovačky.&nbsp;</p><figure class=\\\"image\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/__thumbs/20220906_tipovacka-002.png/20220906_tipovacka-002__800x123.png\\\"></figure><p>Po registraci se dostanete úspěšně do tipovačky a můžete tipovat. Tipovačka je rozdělena na:&nbsp;</p><ul><li>Tipujte zápasy - zde je seznam budoucích zápasů k tipování</li><li>Tipujte pořadí - zde můžete tipovat pořadí a také se podívat po vyhodnocení (na konci soutěže), jak jste s tipy dopadli</li><li>Pořadí - zde je celkové pořadí s body uživatelů. Řazení je celkové body &gt; body za zápasy &gt; body za pořadí.&nbsp;</li><li>Uplynulé zápasy - pokud zápas již začal, přesouvá se sem, kde také uvidíte výsledky (až je admin zadá, čili strpení prosím) a počet bodů, jaký jste dostali.</li><li>Pravidla tipovačky - to je tento text, může být aktualizován.</li></ul><figure class=\\\"image\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/__thumbs/20220906_tipovacka-003.png/20220906_tipovacka-003__800x79.png\\\"></figure><p>Pokud máte vložený tip k zápasu, je zobrazen červeně, pokud ne, modře. Tipování je jednoduché. Extraligu tipujeme bez remíz, pokud remízu zadáte, u tipu bude vyznačeno upozornění, že nedostanete žádný bod.&nbsp;</p><figure class=\\\"image\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/__thumbs/20220906_tipovacka-004.png/20220906_tipovacka-004__800x182.png\\\"></figure><p>Celkové pořadí tipujeme po skončení základní části. Nelze mít jedno umístění dva týmy. Malá rada, pokud chcete zrušit umístění, dejte tam 0 (nulu). Nula není kontrolována, jinak Vám nebude umožněn tip.&nbsp;</p><figure class=\\\"image\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/__thumbs/20220906_tipovacka-005.png/20220906_tipovacka-005__800x293.png\\\"></figure><p>A finálně se můžete dívat na průběžné pořadí. Tipy pořadí jsou vyhodnoceny až po skončení soutěže (až budou známy výsledky), tipy zápasů po skončení zápasu, zpravidla do 24 hodin, ale pokud to nedáme, tak se omlouváme a bude vždy doplněno.&nbsp;</p><figure class=\\\"image\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/__thumbs/20220906_tipovacka-006.png/20220906_tipovacka-006__800x170.png\\\"></figure>', NULL, 0, NULL, '1900-01-01', 2, 1, 'tjirecek', 'tjirecek', '2022-08-30 20:01:54', '2022-09-07 22:43:17'),
(4, 'jak-si-zmenit-registracni-udaje-', NULL, '2022-09-08', 2, 'Jak si změnit registrační údaje', NULL, 'Vaše registrační údaje si můžete kdykoliv změnit. ', NULL, '<p>Máte aktualizovaný email nebo nevyhovuje heslo? Změňte si jednoduše Vaše registrační údaje. Klikněte na <a href=\\\"https://tipovacka.hcpcefans.cz/cz/index/kontakt\\\">menu Kontakt</a> a v jednoduchém formuláři proveďte požadovanou změnu. Změnit jde:&nbsp;</p><ul><li>E-mail - nicméně v databázi nesmí být daný email 2x, čili pokud ho najdeme v databázi, nezměníme ho, objeví se Vám hlášení. V tom případě nás kontaktujte a mrkneme kdo má daný e-mail použitý a nějak se na fóru domluvíme.&nbsp;</li><li>Heslo - pokud chcete změnit heslo, vyplňte dané pole, jinak ho nechte prázdné. Pokud zůstane prázdné, heslo se nezmění. Je zde jediná podmínka, aby heslo bylo alespoň 6 znaků dlouhé a opravdu nepoužívejte heslo 123456, zkuste vymyslet něco lepšího.&nbsp;</li></ul><p>Pokud heslo zapomenete, při přihlášení můžete kliknout a nechat si poslat na e-mail uvedený v registraci zaslat resetovací link pro zadání Vašeho hesla. Při přihlášení klikněte na “Odeslat zapomenuté heslo”.&nbsp;</p><p>Jen pro pořádek, dbáme na bezpečnost. Heslo v databázi nevidíme, je zašifrovanou docela složitým šifrovacím algoritmem, čili pokud zapomenete heslo, je možné ho pouze změnit, nelze ho nijak zobrazit.&nbsp;</p><figure class=\\\"image\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/__thumbs/20220908_registracni-udaje-001.png/20220908_registracni-udaje-001__800x194.png\\\"></figure>', NULL, 0, NULL, '1900-01-01', 2, 1, 'tjirecek', 'tjirecek', '2022-09-07 22:59:02', '2022-09-07 23:07:32'),
(5, 'tipovacka-ms-ve-fotbalu-katar-2022-2022-11-14', NULL, '2022-11-14', 3, 'Tipovačka MS ve fotbalu Katar 2022', NULL, 'Druhou tipovačkou je relax v podobě mistrovství světa ve fotbalu', NULL, '<h4>&nbsp;</h4><h4>Pravidla a popis tipovačky MS ve fotbalu 2022</h4><p>Trošku relaxační tipovačka z toho druhého sportu, a sice z fotbalu u příležitosti mistrovství světa ve fotbalu 2022, které se koná v Kataru od 20.11.2022 do 18.12.2022.</p><p><strong>Kdo se může zúčastnit</strong></p><p>Tipovačka je pro registrované uživatele fóra. Vše lze řešit individuálně a vyhrazujeme si právo uživatele zablokovat (například při porušení pravidel fóra) nebo neschválit. Je to benefit pro skvělé uživatele skvělého fóra pardubických fanoušků.&nbsp;</p><p><strong>Co tipujeme a jak to hodnotíme</strong></p><p>Tipujeme pouze všechny zápasy mistrovství světa ve fotbalu s tím, že finálový pavouk bude mít koeficient 2, čili bude dvojnásobek bodů. Tipujeme i remízy, vyřazovací fáze až do rozhodnutí.</p><ul><li>Přesně tipnutý výsledek zápasu (výhra, remíza) - 3 body</li><li>Tipnutý vítěz a rozdíl ve skóre, tipnutá remíza - 2 body</li><li>Tipnutý vítěz - 1 bod</li><li>Play-Off - v playoff se vše násobí koeficientem 2, čili jsou dvojnásobné body za zápasy play-off.</li></ul><p><strong>O co hrajeme</strong></p><p>Je doplňková krátká tipovačka, čili hrajeme mezi sebou a následně vítěze někde umístíme na webu na pomyslný historický piedestal, v našem případě tedy nějaký “sloup”.&nbsp;</p><p><strong>A jak tipovat</strong></p><p>V seznamu tipovaček či po přihlášení vidíte tipovačky. Oddělení jsou tři: probíhající tipovačky, nadcházející tipovačky a uplynulé tipovačky. Přihlásit se jde pouze do probíhajících tipovaček a uplynulé tipovačky jdou zobrazit jen těm, kteří se jich zúčastnili.&nbsp;</p><figure class=\\\"image image_resized\\\" style=\\\"width:50%;\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/20221114_tipovacka-01.png\\\"></figure><p>Do každé tipovačky je třeba se registrovat. Registrací se zařadíte do pořadí tipovačky a můžete tipovat. Pokud se nechcete registrovat, dejte zpět, jinak klikněte na tlačítko registrovat se do tipovačky.&nbsp;</p><figure class=\\\"image\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/__thumbs/20220906_tipovacka-002.png/20220906_tipovacka-002__800x123.png\\\"></figure><p>Po registraci se dostanete úspěšně do tipovačky a můžete tipovat. Tipovačka je rozdělena na:&nbsp;</p><ul><li>Tipujte zápasy - zde je seznam budoucích zápasů k tipování</li><li>Pořadí - zde je celkové pořadí s body uživatelů. Řazení je celkové body &gt; body za zápasy</li><li>Uplynulé zápasy - pokud zápas již začal, přesouvá se sem, kde také uvidíte výsledky (až je admin zadá, čili strpení prosím) a počet bodů, jaký jste dostali.</li><li>Pravidla tipovačky - to je tento text, může být aktualizován.</li></ul><p>Pokud máte vložený tip k zápasu, je zobrazen červeně, pokud ne, modře. Tipování je jednoduché. Extraligu tipujeme bez remíz, pokud remízu zadáte, u tipu bude vyznačeno upozornění, že nedostanete žádný bod.&nbsp;</p><figure class=\\\"image image_resized\\\" style=\\\"width:50%;\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/20221114_tipovacka-02.png\\\"></figure><p>A finálně se můžete dívat na průběžné pořadí. Tipy zápasů jsou vyhodnoceny po skončení zápasu, zpravidla do 24 hodin, ale pokud to nedáme, tak se omlouváme a bude vždy doplněno.&nbsp;</p><figure class=\\\"image image_resized\\\" style=\\\"width:50%;\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/20221114_tipovacka-03.png\\\"></figure>', NULL, 0, NULL, '2022-11-16', 2, 1, 'tjirecek', 'tjirecek', '2022-11-14 20:11:18', '2022-11-16 15:02:08'),
(6, 'tipovacka-ms-v-hokeji-2023-2023-05-05', NULL, '2023-05-05', 3, 'Tipovačka MS v hokeji 2023', NULL, 'Poslední turnaj sezóny, mistrovství světa v hokeji 2023 začíná', NULL, '<h4>&nbsp;</h4><h4>Pravidla a popis tipovačky MS v hokeji 2023</h4><p>Poslední turnaj sezóny, mistrovství světa v hokeji 2023 začíná a tak pokračujeme v rozjetých tipovačkách.&nbsp;</p><p><strong>Kdo se může zúčastnit</strong></p><p>Tipovačka je pro registrované uživatele fóra. Vše lze řešit individuálně a vyhrazujeme si právo uživatele zablokovat (například při porušení pravidel fóra) nebo neschválit. Je to benefit pro skvělé uživatele skvělého fóra pardubických fanoušků.&nbsp;</p><p><strong>Co tipujeme a jak to hodnotíme</strong></p><p>Tipujeme pouze všechny zápasy mistrovství světa ve fotbalu s tím, že finálový pavouk bude mít koeficient 2, čili bude dvojnásobek bodů. Tipujeme konečný výsledek, čili bez remíz.&nbsp;</p><ul><li>Přesně tipnutý výsledek zápasu (výhra, remíza) - 3 body</li><li>Tipnutý vítěz a rozdíl ve skóre, tipnutá remíza - 2 body</li><li>Tipnutý vítěz - 1 bod</li><li>Play-Off - v playoff se vše násobí koeficientem 2, čili jsou dvojnásobné body za zápasy play-off.</li></ul><p><strong>O co hrajeme</strong></p><p>Kdyby někdo chtěl přidat nějaké ceny pro nejlepší tipéry, tak sem s tím, jinak je to hlavně zábava, čili tipujeme hlavně mezi sebou.&nbsp;</p><p><strong>A jak tipovat</strong></p><p>V seznamu tipovaček či po přihlášení vidíte tipovačky. Oddělení jsou tři: probíhající tipovačky, nadcházející tipovačky a uplynulé tipovačky. Přihlásit se jde pouze do probíhajících tipovaček a uplynulé tipovačky jdou zobrazit jen těm, kteří se jich zúčastnili.&nbsp;</p><figure class=\\\"image image_resized\\\" style=\\\"width:50%;\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/20221114_tipovacka-01.png\\\"></figure><p>Do každé tipovačky je třeba se registrovat. Registrací se zařadíte do pořadí tipovačky a můžete tipovat. Pokud se nechcete registrovat, dejte zpět, jinak klikněte na tlačítko registrovat se do tipovačky.&nbsp;</p><figure class=\\\"image\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/__thumbs/20220906_tipovacka-002.png/20220906_tipovacka-002__800x123.png\\\"></figure><p>Po registraci se dostanete úspěšně do tipovačky a můžete tipovat. Tipovačka je rozdělena na:&nbsp;</p><ul><li>Tipujte zápasy - zde je seznam budoucích zápasů k tipování</li><li>Pořadí - zde je celkové pořadí s body uživatelů. Řazení je celkové body &gt; body za zápasy</li><li>Uplynulé zápasy - pokud zápas již začal, přesouvá se sem, kde také uvidíte výsledky (až je admin zadá, čili strpení prosím) a počet bodů, jaký jste dostali.</li><li>Pravidla tipovačky - to je tento text, může být aktualizován.</li></ul><p>Pokud máte vložený tip k zápasu, je zobrazen červeně, pokud ne, modře. Tipování je jednoduché. Extraligu tipujeme bez remíz, pokud remízu zadáte, u tipu bude vyznačeno upozornění, že nedostanete žádný bod.&nbsp;</p><figure class=\\\"image\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/20230505_tipovacka-01.png\\\"></figure><p>A finálně se můžete dívat na průběžné pořadí. Tipy zápasů jsou vyhodnoceny po skončení zápasu, zpravidla do 24 hodin, ale pokud to nedáme, tak se omlouváme a bude vždy doplněno.&nbsp;</p><figure class=\\\"image image_resized\\\" style=\\\"width:50%;\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/20221114_tipovacka-03.png\\\"></figure>', NULL, 0, NULL, '2023-05-05', 2, 1, 'tjirecek', 'tjirecek', '2023-05-04 22:24:23', '2023-05-04 22:29:34'),
(7, 'vyhodnoceni-tipovacky-elh-2022-2023-2023-05-05', NULL, '2023-05-05', 2, 'Vyhodnocení tipovačky ELH 2022/2023', NULL, '', NULL, '<p><strong>Vyhodnocení tipovačky</strong><br><br><span style=\\\"background-color:rgb(255,255,255);color:rgb(51,51,51);\\\">Sezona je za námi a tak je čas na vyhodnocení tipovačky. Bylo hrozně zajímavé sledovat jak se pořadí přelévalo, jak moc s kartami zamíchaly tipy na pořadí po ZČ a jak do toho mnohdy potom ještě velmi razantně zasáhl dvojnásobek bodů za zápasy playoff. Doufám, že vás tenhle nový formát tipovačky bavil.</span><br><br><span style=\\\"background-color:rgb(255,255,255);color:rgb(51,51,51);\\\">Pokud byste měli jakékoliv nápady, podněty, chtěli dát něco jako výhru do dalších tipovaček nebo cokoliv jiného, tak pište. Teď je právě čas kdy můžeme diskutovat nějaké úpravy na příští ročník.</span><br><br><span style=\\\"background-color:rgb(255,255,255);color:rgb(51,51,51);\\\">Teď už ale sláva vítězům a přikládám tabulku prvních devíti. Všem ohromná gratulace.</span><br>&nbsp;</p><figure class=\\\"image\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/20230505_tipovacka_vysledky.jpg\\\"></figure><p><span style=\\\"background-color:rgb(255,255,255);color:rgb(51,51,51);\\\">Abyste věděli na co se těšit, tak ještě připomínám skvělé výhry, které se z velké části podařilo zajistit díky štědrosti firmy </span><strong>Floorwood.cz a.s.( </strong><a href=\\\"https://www.floorwood.cz/\\\"><strong>https://www.floorwood.cz/</strong></a><strong> )</strong><span style=\\\"background-color:rgb(255,255,255);color:rgb(51,51,51);\\\">, které tímto ještě jednou moc děkuji!</span><br><br><span style=\\\"background-color:rgb(255,255,255);color:rgb(51,51,51);\\\"><strong>1.místo - Teslák</strong> </span><a href=\\\"https://www.alkohol.cz/produkty/malteco-1980-0-7l-40-12632/\\\">https://www.alkohol.cz/produkty/malteco ... -40-12632/</a>&nbsp;<br><span style=\\\"background-color:rgb(255,255,255);color:rgb(51,51,51);\\\"><strong>2.místo - radnov</strong> poukázka do fanshopu na 1500 Kč</span><br><span style=\\\"background-color:rgb(255,255,255);color:rgb(51,51,51);\\\"><strong>3.místo - FOGLIK</strong> bílý fandres Lukáše Radila, XL.</span><br><span style=\\\"background-color:rgb(255,255,255);color:rgb(51,51,51);\\\"><strong>4.místo - jtichy75</strong> poukázka do fanshopu na 1000 Kč</span><br><span style=\\\"background-color:rgb(255,255,255);color:rgb(51,51,51);\\\"><strong>5.místo - cornuto</strong> </span><a href=\\\"https://www.destilerka.cz/fleret-beskyd-willi-willi-40-0-7l\\\">https://www.destilerka.cz/fleret-beskyd ... li-40-0-7l</a><br><span style=\\\"background-color:rgb(255,255,255);color:rgb(51,51,51);\\\"><strong>6.místo - PCE.MAN</strong> kšiltovka Dynamo</span><br><span style=\\\"background-color:rgb(255,255,255);color:rgb(51,51,51);\\\"><strong>7.místo - filipek11111</strong> kulich Dynamo</span><br><span style=\\\"background-color:rgb(255,255,255);color:rgb(51,51,51);\\\"><strong>8.místo - SiderOut</strong> šála Dynamo</span><br><span style=\\\"background-color:rgb(255,255,255);color:rgb(51,51,51);\\\"><strong>9.místo - Vakr</strong> klasika mezi vodkami, Finlandia.</span><br><span style=\\\"background-color:rgb(255,255,255);color:rgb(51,51,51);\\\">Díky všem za účast a vidíme se u dalších tipovaček! </span><img src=\\\"https://forum.hcpcefans.cz/images/smilies/pivko.gif\\\" alt=\\\":pivko:\\\"></p>', NULL, 0, NULL, '2023-05-05', 2, 1, 'tjirecek', 'tjirecek', '2023-05-04 22:42:15', '2023-05-04 22:50:52'),
(8, 'tipovacka-chl-2023-2024-2023-08-17', NULL, '2023-08-17', 3, 'Tipovačka CHL 2023/2024', NULL, 'Tipujeme všechny zápasy hokejové ligy mistrů.', NULL, '<h4>Další rok, druhá sezóna tipovaček, začínáme hokejovou ligou mistrů</h4><p>Od 31.8.2023 se rozběhne hokejová liga mistrů sezóna 2023/2024 a jelikož účastníkem je i náš klub, tak si dáme tipovačku všech zápasů hokejové ligy mistrů. Buď vyniknou znalci evropského hokeje, anebo ti, kteří budou mít šťastnou ruku.&nbsp;</p><p><strong>Kdo se může zúčastnit</strong></p><p>Tipovačka je pro registrované uživatele fóra. Vše lze řešit individuálně a vyhrazujeme si právo uživatele zablokovat (například při porušení pravidel fóra) nebo neschválit. Je to benefit pro skvělé uživatele skvělého fóra pardubických fanoušků. Pokud jste nový uživatel fóra, napište si přes kontakty, na fóru, o zpřístupnění tipovačky.&nbsp;</p><p><strong>Co tipujeme a jak to hodnotíme</strong></p><p>Tipujeme pouze všechny zápasy s tím, že finálový pavouk bude mít koeficient 2, čili bude dvojnásobek bodů. Tipujeme konečný výsledek, čili bez remíz.&nbsp;</p><ul><li>Přesně tipnutý výsledek zápasu (výhra, remíza) - 3 body</li><li>Tipnutý vítěz a rozdíl ve skóre, tipnutá remíza - 2 body</li><li>Tipnutý vítěz - 1 bod</li><li>Play-Off - v playoff se vše násobí koeficientem 2, čili jsou dvojnásobné body za zápasy play-off.</li></ul><p><strong>O co hrajeme</strong></p><p>Kdyby někdo chtěl přidat nějaké ceny pro nejlepší tipéry, tak sem s tím, jinak je to hlavně zábava, čili tipujeme hlavně mezi sebou.&nbsp;</p><p><strong>A jak tipovat</strong></p><p>V seznamu tipovaček či po přihlášení vidíte tipovačky. Oddělení jsou tři: probíhající tipovačky, nadcházející tipovačky a uplynulé tipovačky. Přihlásit se jde pouze do probíhajících tipovaček a uplynulé tipovačky jdou zobrazit jen těm, kteří se jich zúčastnili.&nbsp;</p><p>Do každé tipovačky je třeba se registrovat. Registrací se zařadíte do pořadí tipovačky a můžete tipovat. Pokud se nechcete registrovat, dejte zpět, jinak klikněte na tlačítko registrovat se do tipovačky.&nbsp;</p><figure class=\\\"image\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/__thumbs/20220906_tipovacka-002.png/20220906_tipovacka-002__800x123.png\\\"></figure><p>Po registraci se dostanete úspěšně do tipovačky a můžete tipovat. Tipovačka je rozdělena na:&nbsp;</p><ul><li>Tipujte zápasy - zde je seznam budoucích zápasů k tipování</li><li>Pořadí - zde je celkové pořadí s body uživatelů. Řazení je celkové body &gt; body za zápasy</li><li>Uplynulé zápasy - pokud zápas již začal, přesouvá se sem, kde také uvidíte výsledky (až je admin zadá, čili strpení prosím) a počet bodů, jaký jste dostali.</li><li>Pravidla tipovačky - to je tento text, může být aktualizován.</li></ul><p>Pokud máte vložený tip k zápasu, je zobrazen červeně, pokud ne, modře. Tipování je jednoduché.&nbsp;</p><p>A finálně se můžete dívat na průběžné pořadí. Tipy zápasů jsou vyhodnoceny po skončení zápasu, zpravidla do 24 hodin, ale pokud to nedáme, tak se omlouváme a bude vždy doplněno co nejdříve.&nbsp;</p><p>Hodně štěstí v tipování.&nbsp;</p><p>&nbsp;</p>', NULL, 0, NULL, '2023-08-17', 2, 1, 'tjirecek', 'tjirecek', '2023-08-16 23:12:59', '2023-08-16 23:25:14'),
(9, 'tipovacka-extraliga-2023-2024-dynamo-2023-09-01', NULL, '2023-09-01', 3, 'Tipovačka extraliga 2023/2024 Dynamo', NULL, 'Nová sezóna, nová tipovačka zápasů Dynama', NULL, '<h4>Pravidla a popis tipovačky Tipsport extraligy 2023/2024</h4><p>Druhý ročník tipovačky zápasů Dynama v Tipsport extralize a celého play-off.&nbsp;</p><p><strong>Kdo se může zúčastnit</strong></p><p>Tipovačka je pro registrované uživatele fóra. Vše lze řešit individuálně a vyhrazujeme si právo uživatele zablokovat (například při porušení pravidel fóra) nebo neschválit. Je to benefit pro skvělé uživatele skvělého fóra pardubických fanoušků.&nbsp;</p><p><strong>Co tipujeme a jak to hodnotíme</strong></p><p>Tipujeme celkové pořadí týmů (po základní části) a zápasy našeho Dynama včetně play-off. Celkové pořadí týmů lze tipovat do 15.9.2023 a každý zápas lze tipovat skoro do začátku zápasu (vždy je uvedeno u tipu do kdy). Tabulka v celkovém pořadí musí být unikátní, čili nelze mít stejné umístění pro dva týmy. Zápasy tipujeme bez remíz! a konečný výsledek (po prodloužení či nájezdech).</p><ul><li>Trefa v pořadí - 10 bodů</li><li>Trefa o jedno místo v pořadí - 5 bodů</li><li>Trefa o dvě místa v pořadí - 3 body</li><li>Přesně tipnutý výsledek zápasu - 3 body</li><li>Tipnutý vítěz a rozdíl ve skóre - 2 body</li><li>Tipnutý vítěz - 1 bod</li><li>Play-Off - v playoff se vie násobí koeficientem 2, čili jsou dvojnásobné body za zápasy play-off.</li></ul><p><strong>O co hrajeme</strong></p><ol><li>Originální dres s certifikací z edice PS37 (hráč je překvapení pro vítěze), nenošený, pouze rozbalený k nafocení</li></ol><p><img class=\\\"image_resized\\\" style=\\\"width:45.48%;\\\" src=\\\"https://tipovacka.hcpcefans.cz/files/images/20230908_dres4.jpg\\\"></p><p>Další výhry budou doplňovány.</p><p>Speciální poděkování za sponzoring patří firmě <a href=\\\"https://www.floorwood.cz\\\">Floorwood</a>&nbsp;</p><p><strong>A jak tipovat</strong></p><p>V seznamu tipovaček či po přihlášení vidíte tipovačky. Oddělení jsou tři: probíhající tipovačky, nadcházející tipovačky a uplynulé tipovačky. Přihlásit se jde pouze do probíhajících tipovaček a uplynulé tipovačky jdou zobrazit jen těm, kteří se jich zúčastnili.&nbsp;</p><figure class=\\\"image\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/__thumbs/20220609_tipovacka-001.png/20220609_tipovacka-001__480x265.png\\\"></figure><p>Do každé tipovačky je třeba se registrovat. Registrací se zařadíte do pořadí tipovačky a můžete tipovat. Pokud se nechcete registrovat, dejte zpět, jinak klikněte na tlačítko registrovat se do tipovačky.&nbsp;</p><figure class=\\\"image\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/__thumbs/20220906_tipovacka-002.png/20220906_tipovacka-002__800x123.png\\\"></figure><p>Po registraci se dostanete úspěšně do tipovačky a můžete tipovat. Tipovačka je rozdělena na:&nbsp;</p><ul><li>Tipujte zápasy - zde je seznam budoucích zápasů k tipování</li><li>Tipujte pořadí - zde můžete tipovat pořadí a také se podívat po vyhodnocení (na konci soutěže), jak jste s tipy dopadli</li><li>Pořadí - zde je celkové pořadí s body uživatelů. Řazení je celkové body &gt; body za zápasy &gt; body za pořadí.&nbsp;</li><li>Uplynulé zápasy - pokud zápas již začal, přesouvá se sem, kde také uvidíte výsledky (až je admin zadá, čili strpení prosím) a počet bodů, jaký jste dostali.</li><li>Pravidla tipovačky - to je tento text, může být aktualizován.</li></ul><figure class=\\\"image\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/__thumbs/20220906_tipovacka-003.png/20220906_tipovacka-003__800x79.png\\\"></figure><p>Pokud máte vložený tip k zápasu, je zobrazen červeně, pokud ne, modře. Tipování je jednoduché. Extraligu tipujeme bez remíz, pokud remízu zadáte, u tipu bude vyznačeno upozornění, že nedostanete žádný bod.&nbsp;</p><figure class=\\\"image\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/__thumbs/20220906_tipovacka-004.png/20220906_tipovacka-004__800x182.png\\\"></figure><p>Celkové pořadí tipujeme po skončení základní části. Nelze mít jedno umístění dva týmy. Malá rada, pokud chcete zrušit umístění, dejte tam 0 (nulu). Nula není kontrolována, jinak Vám nebude umožněn tip.&nbsp;</p><figure class=\\\"image\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/__thumbs/20220906_tipovacka-005.png/20220906_tipovacka-005__800x293.png\\\"></figure><p>A finálně se můžete dívat na průběžné pořadí. Tipy pořadí jsou vyhodnoceny až po skončení soutěže (až budou známy výsledky), tipy zápasů po skončení zápasu, zpravidla do 24 hodin, ale pokud to nedáme, tak se omlouváme a bude vždy doplněno.&nbsp;</p><figure class=\\\"image\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/__thumbs/20220906_tipovacka-006.png/20220906_tipovacka-006__800x170.png\\\"></figure>', NULL, 0, NULL, '2023-09-01', 2, 1, 'tjirecek', 'tjirecek', '2023-08-31 23:48:54', '2023-09-08 10:44:15'),
(10, 'novinky-upravy-v-tipovacce-2999-12-31', NULL, '2999-12-31', 2, 'Novinky v tipovačce', NULL, 'Log novinek a změn v tipovačce', NULL, '<p>Zde bude vypsaný seznam změn v aplikaci, tipovačce v pořadí tak, jak budou úpravy, nové nastavení, nové tipovačky, na webu přibývat.&nbsp;</p><ul><li><code>5.9.2025 - spuštěna tipovačka pro nadcházející ročník extraligy 2025/2026</code></li><li><code>17.9.2024 - nová tipovačka pro sezónu 2024/2025 a zároveň nové přihlášení na tipovačku, sjednocené s hlavním fórem</code></li><li><code>17.8.2023 - přidání nové tipovačky CHL (Liga mistrů) 2023/2024 (tipovačka, zápasy, tipy pořadí, nastavení pro celou tipovačku)</code></li><li><code>1.9.2023 - přidání nové tipovačky Extraliga 2023/2024 (tipovačka, zápasy, tipy pořadí, nastavení pro celou tipovačku)</code></li><li><code>2.9.2023 - ošetření duplicitního zadání tipu zápasu do tipovačky, optimalizovaná úvodní stránka</code></li></ul>', NULL, 0, NULL, '1900-01-01', 2, 1, 'tjirecek', 'tjirecek', '2023-09-01 23:29:19', '2025-09-05 20:16:24'),
(11, 'start-noveho-rocniku-extraligy-i-tipovacky-2023-09-15', NULL, '2023-09-15', 2, 'Start nového ročníku extraligy i tipovačky', NULL, 'Dnes začíná nová sezóna extraligy ledního hokeje ..', NULL, '<p>Vážení kolegové z fóra Hcpcefans.cz,</p><p>Dnes začíná druhá sezóna tipovačky zápasů Dynama v extralize ledního hokeje. Pokud ještě nejste přihlášení, můžete tak učinit, můžete tak učinit dnes, či zítra či někdy jindy, na tipovačku to nemá vliv. Vliv to má na to, že Vám budou chybět nějaké zápasy, ale hlavně do 20.9.2023 se tipuje celkové pořadí extraligy. A za celkové pořadí extraligy po základní části je docela dost bodů, tak by byla škoda to prováhat.&nbsp;</p><p><a href=\\\"https://tipovacka.hcpcefans.cz\\\">https://tipovacka.hcpcefans.cz</a></p><p>Hodně štěstí ve Vašich tipech.&nbsp;</p>', NULL, 0, NULL, '2023-09-15', 0, 1, 'tjirecek', 'tjirecek', '2023-09-14 22:33:32', '2023-09-14 22:33:44'),
(12, 'tipovacka-euro-2024-nemecko-2024-06-08', NULL, '2024-06-08', 3, 'Tipovačka Euro 2024 Německo', NULL, 'Zápasy Euro 2024 ve fotbalu', NULL, '<h4>&nbsp;</h4><h4>Pravidla a popis tipovačky ME ve fotbalu 2024 Německo</h4><p>Při čekání na sezónu si můžete zpříjemnit večery fotbalem, konkrétně mistrovstvím Evropy 2024, které se koná v Německu v termínu 14.6.2024 až 14.7.2024.&nbsp;</p><p><strong>Kdo se může zúčastnit</strong></p><p>Tipovačka je pro registrované uživatele fóra. Vše lze řešit individuálně a vyhrazujeme si právo uživatele zablokovat (například při porušení pravidel fóra) nebo neschválit. Je to benefit pro skvělé uživatele skvělého fóra pardubických fanoušků.&nbsp;</p><p><strong>Co tipujeme a jak to hodnotíme</strong></p><p>Tipujeme pouze všechny zápasy mistrovství světa ve fotbalu s tím, že finálový pavouk bude mít koeficient 2, čili bude dvojnásobek bodů. Tipujeme i remízy, vyřazovací fáze až do rozhodnutí.</p><ul><li>Přesně tipnutý výsledek zápasu (výhra, remíza) - 3 body</li><li>Tipnutý vítěz a rozdíl ve skóre, tipnutá remíza - 2 body</li><li>Tipnutý vítěz - 1 bod</li><li>Play-Off - v playoff se vše násobí koeficientem 2, čili jsou dvojnásobné body za zápasy play-off.</li></ul><p><strong>O co hrajeme</strong></p><p>Je doplňková krátká tipovačka, čili hrajeme mezi sebou a následně vítěze někde umístíme na webu na pomyslný historický piedestal, v našem případě tedy nějaký “sloup”.&nbsp;</p><p><strong>A jak tipovat</strong></p><p>V seznamu tipovaček či po přihlášení vidíte tipovačky. Oddělení jsou tři: probíhající tipovačky, nadcházející tipovačky a uplynulé tipovačky. Přihlásit se jde pouze do probíhajících tipovaček a uplynulé tipovačky jdou zobrazit jen těm, kteří se jich zúčastnili.&nbsp;</p><p>Do každé tipovačky je třeba se registrovat. Registrací se zařadíte do pořadí tipovačky a můžete tipovat. Pokud se nechcete registrovat, dejte zpět, jinak klikněte na tlačítko registrovat se do tipovačky.&nbsp;</p><figure class=\\\"image\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/__thumbs/20220906_tipovacka-002.png/20220906_tipovacka-002__800x123.png\\\"></figure><p>Po registraci se dostanete úspěšně do tipovačky a můžete tipovat. Tipovačka je rozdělena na:&nbsp;</p><ul><li>Tipujte zápasy - zde je seznam budoucích zápasů k tipování</li><li>Pořadí - zde je celkové pořadí s body uživatelů. Řazení je celkové body &gt; body za zápasy</li><li>Uplynulé zápasy - pokud zápas již začal, přesouvá se sem, kde také uvidíte výsledky (až je admin zadá, čili strpení prosím) a počet bodů, jaký jste dostali.</li><li>Pravidla tipovačky - to je tento text, může být aktualizován.</li></ul><p>Pokud máte vložený tip k zápasu, je zobrazen červeně, pokud ne, modře. Tipování je jednoduché. Extraligu tipujeme bez remíz, pokud remízu zadáte, u tipu bude vyznačeno upozornění, že nedostanete žádný bod.&nbsp;</p><p>A finálně se můžete dívat na průběžné pořadí. Tipy zápasů jsou vyhodnoceny po skončení zápasu, zpravidla do 24 hodin, ale pokud to nedáme, tak se omlouváme a bude vždy doplněno.&nbsp;</p><figure class=\\\"image image_resized\\\" style=\\\"width:50%;\\\"><img src=\\\"https://tipovacka.hcpcefans.cz/files/images/20221114_tipovacka-03.png\\\"></figure>', NULL, 0, NULL, '2024-06-08', 2, 1, 'tjirecek', 'tjirecek', '2024-06-07 23:12:24', '2024-06-08 00:02:48'),
(13, 'treti-sezona-hlavni-tipovacky-2024-09-08', NULL, '2024-09-08', 3, 'Třetí sezóna hlavní tipovačky', NULL, 'Startujeme třetí sezónu nové online tipovačky.', NULL, '<p><strong>Pravidla tipovačky</strong></p><p>Již zde nebudeme popisovat detailně tipovačku, již ji má většina zažitou, pokud ne a něco nevíte, zeptejte se na fóru. Zopakujeme si pouze základní pravidla. U každého zápasu je datum a čas zápasu a konec tipu, tj. kdy budou tipy na daný zápas uzavřeny. Vyhodnocení zápasu bude vloženo na web co nejdříve po skončení, ale někdy se stane, že to je déle.&nbsp;</p><ul><li>Tipujeme pouze zápasy našeho Dynama v základní části. Koeficient v základní části je 1.</li><li>V nadstavbové části, play-off, tipujeme již všechny zápasy. Koeficient v nadstavbě je 2, čili body se násobí 2x.&nbsp;</li><li>Tipujeme výsledek zápasu do konce zápasu.&nbsp;</li><li>Přesně tipnuté skóre = 3 body</li><li>Tipnutý správně vítěz a rozdíl ve skóre = 2 body</li><li>Tipnutý správně vítěz zápasu = 1 bod</li></ul><p><strong>Tipování pořadí - končí 25.9.2024</strong></p><p>Do 25.9.2024 včetně tipujte výsledné pořadí po základní části, hraje se o dost bodů. Vyhodnocení logicky je po ukončení základní části.&nbsp;</p><ul><li>Správně tipnuté pořadí = 10 bodů</li><li>Chyba v pořadí o jedno místo = 5 bodů&nbsp;</li><li>Chyba v pořadí o dvě místa = 3 body</li></ul><p><strong>Výhry a odměny</strong></p><p>Primární je dobrý pocit a soutěživost mezi uživateli fóra. Nadstavbově budou odměněni minimálně první tři tipéři, ceny budou doplněny.&nbsp;</p>', NULL, 0, NULL, '1900-01-01', 2, 1, 'tjirecek', 'tjirecek', '2024-09-07 23:41:29', '2024-09-08 00:02:45'),
(14, 'prihlaste-se-do-tipovacky-na-foru-hcpcefans-2025-09-05', NULL, '2025-09-05', 2, 'Přihlaste se do tipovačky na fóru hcpcefans', NULL, 'Tipujte se kolegy ročník 2025/2026 zápasy Dynama. ', NULL, '<p><strong>Tipovačka 2025/2026 spuštěna - přihlaste</strong></p><p><a href=\\\"https://tipovacka.hcpcefans.cz\\\">https://tipovacka.hcpcefans.cz</a></p><p>Na webu je již spuštěna tipovačka na novou sezónu. Po přihlášení uvidíte probíhající tipovačku, do které je potřeba se registrovat (kliknutím na tipovačku a následně ještě jedno kliknutí na registraci, toť vše). Pokud nebudeme někomu něco jasné, pište sem, soukromou zprávu, apod.</p><p>Pozor: do 20.9.2025 tipujeme konečné pořadí, tak si to nezapomeňte naklikat.</p><p><strong>Pravidla tipovačky</strong></p><p>Již zde nebudeme popisovat detailně tipovačku, již ji má většina zažitou, pokud ne a něco nevíte, zeptejte se na fóru. Zopakujeme si pouze základní pravidla. U každého zápasu je datum a čas zápasu a konec tipu, tj. kdy budou tipy na daný zápas uzavřeny. Vyhodnocení zápasu bude vloženo na web co nejdříve po skončení, ale někdy se stane, že to je déle.</p><ul><li>Tipujeme pouze zápasy našeho Dynama v základní části. Koeficient v základní části je 1.</li><li>V nadstavbové části, play-off, tipujeme již všechny zápasy. Koeficient v nadstavbě je 2, čili body se násobí 2x.</li><li>Tipujeme výsledek zápasu do konce zápasu.</li><li>Přesně tipnuté skóre = 3 body</li><li>Tipnutý správně vítěz a rozdíl ve skóre = 2 body</li><li>Tipnutý správně vítěz zápasu = 1 bod</li></ul><p><strong>Tipování pořadí - končí 20.9.2025</strong></p><p>Do 20.9.2025 včetně tipujte výsledné pořadí po základní části, hraje se o dost bodů. Vyhodnocení logicky je po ukončení základní části.</p><ul><li>Správně tipnuté pořadí = 10 bodů</li><li>Chyba v pořadí o jedno místo = 5 bodů</li><li>Chyba v pořadí o dvě místa = 3 body</li></ul>', NULL, 0, NULL, '2024-09-17', 0, 1, 'tjirecek', 'tjirecek', '2024-09-16 22:28:18', '2025-09-05 20:11:24'),
(15, 'tipovacka-extraliga-2024-2025', NULL, '2025-09-05', 3, 'Extraliga 2025/2026', NULL, 'Čtvrtá sezóna tipovačky je tady', NULL, '<p><strong>Pravidla tipovačky</strong></p><p>Již zde nebudeme popisovat detailně tipovačku, již ji má většina zažitou, pokud ne a něco nevíte, zeptejte se na fóru. Zopakujeme si pouze základní pravidla. U každého zápasu je datum a čas zápasu a konec tipu, tj. kdy budou tipy na daný zápas uzavřeny. Vyhodnocení zápasu bude vloženo na web co nejdříve po skončení, ale někdy se stane, že to je déle.&nbsp;</p><ul><li>Tipujeme pouze zápasy našeho Dynama v základní části. Koeficient v základní části je 1.</li><li>V nadstavbové části, play-off, tipujeme již všechny zápasy. Koeficient v nadstavbě je 2, čili body se násobí 2x.&nbsp;</li><li>Tipujeme výsledek zápasu do konce zápasu.&nbsp;</li><li>Přesně tipnuté skóre = 3 body</li><li>Tipnutý správně vítěz a rozdíl ve skóre = 2 body</li><li>Tipnutý správně vítěz zápasu = 1 bod</li></ul><p><strong>Tipování pořadí - končí 20.9.2025</strong></p><p>Do 20.9.2025 včetně tipujte výsledné pořadí po základní části, hraje se o dost bodů. Vyhodnocení logicky je po ukončení základní části.&nbsp;</p><ul><li>Správně tipnuté pořadí = 10 bodů</li><li>Chyba v pořadí o jedno místo = 5 bodů&nbsp;</li><li>Chyba v pořadí o dvě místa = 3 body</li></ul>', NULL, 0, NULL, '1900-01-01', 2, 1, 'tjirecek', 'tjirecek', '2025-09-05 20:01:53', '2025-09-05 20:10:15');
