(7, 980, 'Pravidla používání', NULL, '<h3>Obecné povědomí</h3><p>Svým přístupem na „hcpceFANS.cz ·Tipovačka pardubických fanoušků“ (dále jen „my“, „naše“, „nás“, “hcpceFANS.cz · Tipovačka pardubických fanoušků”, “https://tipovacka.hcpcefans.cz”), souhlasíte s&nbsp;následujícími podmínkami. Pokud nesouhlasíte, neprodleně opusťte „hcpceFANS.cz · Tipovačka pardubických fanoušků“, nevstupujte na něj a nepoužívejte jej. Vyhrazujeme si právo tyto podmínky kdykoliv změnit a učiníme vše potřebné pro to, abychom vás o&nbsp;této změně informovali. Přesto je rozumné tyto podmínky průběžně sledovat vzhledem k&nbsp;tomu, že používáním „hcpceFANS.cz · Tipovačka pardubických fanoušků“ s&nbsp;nimi souhlasíte.&nbsp;</p><h3>Slušné chování</h3><p>Zavazujete se nepřispívat na fórum pohoršujícím, hanlivým, nevhodným, vulgárním nebo jiným materiálem, který by mohl porušovat platné zákony ve vaší zemi, zákony v&nbsp;zemi, kde sídlí „hcpceFANS.cz · Tipovačka pardubických fanoušků“, nebo platné mezinárodní právo. Tato činnost může vést k&nbsp;okamžitému a trvalému vykázání z tipovačky a/nebo upozornění vašeho poskytovatele internetových služeb (ISP) na vaši činnost, pokud bude uznáno za nutné. IP adresy všech příspěvků jsou ukládány pro případné uplatnění těchto opatření. Souhlasíte s&nbsp;tím, že „hcpceFANS.cz · Jako uživatel souhlasíte se všemi údaji uloženými v&nbsp;databázi. Přestože „hcpceFANS.cz · Tipovačka pardubických fanoušků“ neposkytne tyto informace třetí straně nebo cizím osobám, nepřebírá „hcpceFANS.cz · Tipovačka pardubických fanoušků“ zodpovědnost za jakýkoliv pokus o&nbsp;vniknutí do systému, který by mohl vést ke kompromitaci těchto dat.</p><h3>Závěrečné ujednání</h3><p>Tipovačka je provázána s diskuzním fórem, čili pravidla platná v diskuzním fóru jsou platná v tipovačce. Uživatel může být kdykoliv i po předchozím neupozornění zablokován, pokud poruší pravidla, či jeho chování bude ovlivňovat provoz tipovačky.&nbsp;</p><p>Na odměny v tipovačce neexistuje právní nárok a ani nárok na doručení odměny. Vše je řešeno písemnou domluvou mezi správci, organizátory tipovačky, formou soukromých zpráv na fóru.</p><p>Vyhrazujeme si právo na chyby. Pokud se chyby objeví, budeme se je snažit neprodleně opravit, ale může nastat ztráta dat. Tipovačky se zúčastňujete dobrovolně.&nbsp;</p>', NULL, 0, 12, 1, 'tjirecek', 'tjirecek', '2022-09-06 21:23:38', '2022-09-07 22:43:17'),
(8, 990, 'Cookies', NULL, '<h2 style=\\\"margin-left:0px;\\\">Podmínky práce s cookies na webu TIPOVACKA.HCPCEFANS.cz</h2><p style=\\\"margin-left:0px;\\\">Správci a provozovatelé webu tipovacka.hcpcefans.cz používají cookies v souvislosti s provozem jejích webových stránek tipovacka.hcpcefans.cz (dále jen „<strong>web</strong>“).</p><p style=\\\"margin-left:0px;\\\">Účelem tohoto dokumentu Podmínky práce s cookies (dále jen „<strong>podmínky</strong>“) je seznámit Vás se způsobem nakládání s cookies, s tím souvisejícím zpracováním osobních údajů a dále poskytnout Vám přehled všech Vašich práv ve smyslu zákona č. 127/2005 Sb., o elektronických komunikacích (dále jen „<strong>ZEK</strong>“) a ve smyslu nařízení č. 2016/679, obecné nařízení o ochraně osobních údajů (dále jen „<strong>GDPR</strong>“). Jako návštěvník webu jste povinen si tyto podmínky přečíst a v případě, že nerozumíte některé informaci či pokud budete cokoli potřebovat, můžete se obrátit na email: tipovacka@hcpcefans.cz</p><h2 style=\\\"margin-left:0px;\\\">Co jsou cookies?</h2><p style=\\\"margin-left:0px;\\\">Soubory cookie používáme k analýze údajů o našich návštěvnících, ke zlepšení našich webových stránek, zobrazení personalizovaného obsahu a k tomu, abychom vám poskytli skvělý zážitek z webu.</p><h2 style=\\\"margin-left:0px;\\\">Funkční cookies</h2><p style=\\\"margin-left:0px;\\\">Tyto soubory cookie jsou nezbytné pro fungování webových stránek, není tedy možné je zakázat. Obvykle se nastavují v reakci na akci, kterou na webu sami provedete, jako je nastavení zabezpečení, přihlášení a vyplňování formulářů. Svůj prohlížeč můžete nastavit tak, aby blokoval soubory cookie nebo o nich zasílal upozornění. Mějte na paměti, že některé stránky nebudou bez těchto souborů fungovat. Tyto soubory cookie neukládají žádné informace, které lze přiřadit konkrétní osobě. Tyto soubory cookie můžeme nastavit my nebo poskytovatelé třetích stran, jejichž služby na webu využíváme. Tyto soubory cookie neukládají žádné informace, které lze přiřadit konkrétní osobě.</p><figure class=\\\"table\\\" style=\\\"width:838px;\\\"><table><colgroup><col style=\\\"width:50%;\\\"><col style=\\\"width:50%;\\\"></colgroup><tbody><tr><th style=\\\"padding:0.5rem 0px;\\\">Cookie</th><th style=\\\"padding:0.5rem 0px;\\\">cc_cookie</th></tr><tr><th style=\\\"padding:0.5rem 0px;\\\">Doména</th><th style=\\\"padding:0.5rem 0px;\\\">tipovacka.hcpcefans.cz</th></tr><tr><th style=\\\"padding:0.5rem 0px;\\\">Platnost</th><th style=\\\"padding:0.5rem 0px;\\\">182 dní</th></tr><tr><th style=\\\"padding:0.5rem 0px;\\\">Popis</th><th style=\\\"padding:0.5rem 0px;\\\">Ukládá souhlas uživatele s používáním cookies.</th></tr><tr><th style=\\\"padding:0.5rem 0px;\\\">Zpracovatel</th><th style=\\\"padding:0.5rem 0px;\\\">Tipovačka pardubických fanoušků</th></tr></tbody></table></figure><figure class=\\\"table\\\" style=\\\"width:838px;\\\"><table><colgroup><col style=\\\"width:50%;\\\"><col style=\\\"width:50%;\\\"></colgroup><tbody><tr><th style=\\\"padding:0.5rem 0px;\\\">Cookie</th><th style=\\\"padding:0.5rem 0px;\\\">PHPSESSID</th></tr><tr><th style=\\\"padding:0.5rem 0px;\\\">Doména</th><th style=\\\"padding:0.5rem 0px;\\\">tipovacka.hcpcefans.cz</th></tr><tr><th style=\\\"padding:0.5rem 0px;\\\">Platnost</th><th style=\\\"padding:0.5rem 0px;\\\">Relace</th></tr><tr><th style=\\\"padding:0.5rem 0px;\\\">Popis</th><th style=\\\"padding:0.5rem 0px;\\\">Ukládá informace o uživatelově relaci.</th></tr><tr><th style=\\\"padding:0.5rem 0px;\\\">Zpracovatel</th><th style=\\\"padding:0.5rem 0px;\\\">Tipovačka pardubických fanoušků</th></tr></tbody></table></figure><h2 style=\\\"margin-left:0px;\\\">Analytické cookies</h2><p style=\\\"margin-left:0px;\\\">Tyto soubory cookie se používají ke zlepšení fungování webových stránek. Umožňují nám rozpoznat a sledovat počet návštěvníků a sledovat, jak návštěvníci web používají. Pomáhají nám zlepšovat způsob, jakým webové stránky fungují, například tím, že uživatelům umož