0px;\\\">Proti provádění přímého marketingu můžete kdykoliv podat námitky. Nastavení je možno změnit po kliknutí na tlačítko „Spravovat souhlas“ v levém dolním rohu obrazovky. Většina internetových prohlížečů také umožňuje prostřednictvím svého nastavení kontrolovat většinu druhů cookies. Můžete si tedy prohlížeč nastavit tak, aby Vás informoval o přijetí cookies a můžete se rozhodnout, zda použití cookies potvrdíte nebo nikoliv. Můžete také cookies zcela vypnout nebo zakázat. Více informací naleznete v nápovědě ke svému prohlížeči. Cookies, které jsou již uložené, můžete průběžně mazat ze svého počítače. Nastavením v rámci cookies lišty je udělen souhlas a může jím být také odvolán. Souhlas, který jste tímto dobrovolně udělil, je možné kdykoliv bezplatně odvolat.</p><h2 style=\\\"margin-left:0px;\\\">K těmto podmínkám</h2><p style=\\\"margin-left:0px;\\\">Tento dokument nabývá účinnosti dne 1. 9. 2022. Jsme oprávněni v případě potřeby tyto podmínky aktualizovat. Při prohlížení našich internetových stránek se vždy informujte o aktuálním znění těchto podmínek. Nové znění je účinné zveřejněním. To je vždy zobrazeno na našich internetových stránkách a je tak umožněna jeho archivace a reprodukce.</p>', NULL, 0, 12, 1, 'tjirecek', 'tjirecek', '2022-09-06 21:34:57', '2022-09-07 22:43:17');
